        <div class="btns">
            <!-- <div (click)="route1()" class="submitBtn"> Introduction  </div> -->
            <!-- <div (click)="route2()" class="submitBtn"> Token  </div> -->
            <!-- <div (click)="route3()" class="submitBtn"> All users  </div>
            <div (click)="route8()" class="submitBtn"> All logged on  </div> -->
            <div (click)="testAPI()" class="submitBtn"> Test connection </div>
            <div (click)="addProduct()" class="submitBtn"> Add product </div>
            <div (click)="seeProduct()" class="submitBtn"> See product </div>
            <div (click)="checkDepot()" class="submitBtn"> Check Depot </div>
            <div (click)="addMoney()" class="submitBtn"> Add $1000 </div>
