        </div>

        <div class="response">
            <h2> Response: </h2>
            <p> {{response}} </p>
        </div>

        <ul class="users">
            <li *ngFor="let user of users">
                <b> {{user.name}} </b> {{user.email}} 
            </li>
        </ul>
